INSERT INTO `pg_park` VALUES (1, 'f08f2263ff26487599535326f0a43680', '510', 'fc9a238c4b7f4499a0495e77ce3a8ace', '中山公园', '<p><strong>中山公园简介：</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;位于厦门闹市区中心，始建于1926年，占地16万平方米，当年为纪念孙中山先生，弘扬其“天下为公”精神，故命名为“中山公园”。 园内依山就势，一派葱笼，层层叠叠，石径盘旋，人行其间宛若置身深山幽谷。公园几经兴废，自1983年以来政府多次拨款重建和休整，使公园旧貌换新颜。</p><p><strong>园内主要景点：&nbsp;</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;1、各具特色的东、西、南、北四个园门，尤以南门最为壮观；&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;2、孙中山先生纪念碑，碑高20米，上书“天下为公”四个大字；</p><p>&nbsp;&nbsp;&nbsp;&nbsp;3、孙中山站立铜像，庄严肃穆；&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;4、园内魁星山、魁星河、廖花溪和亭台楼榭、小桥等构成一幅江南山水画，令人心旷神怡；</p><p>&nbsp;&nbsp;&nbsp;&nbsp;5、园中有园，情趣盎然，逸趣园、游乐园、动物园、花展馆等为公园锦上添花。</p><p><br></p>', '思明区', 'cbc', '24.463478830380772,118.08446645736696;24.46205303605471,118.08356523513795;24.461613575645167,118.08387637138368;24.460842074772856,118.0838978290558;24.46096903093744,118.08313608169557;24.460588162059757,118.08300733566286;24.460090101020388,118.08369398117067;24.459572506088733,118.08338284492494;24.459367420716163,118.08494925498964;24.46095926508317,118.08545351028444;24.46268780949472,118.08701992034914;24.46379133109009,118.08781385421754;24.46409406541275,118.08765292167665', NULL, '10.11.0.87', NULL, '2022-09-02 11:21:39', NULL, '2022-09-02 11:30:56', 'cbc', '0');
INSERT INTO `pg_park` VALUES (2, '1aa51320977a42b489748dc2e23a21fc', '12000', '0ede0b242c3d482f9d16088f3fa58958', '厦门植物园', '<p>	厦门园林植物园，俗称“万石植物园”，位于福建省<a href=\"https://baike.baidu.com/item/%E5%8E%A6%E9%97%A8%E5%B2%9B/5630242?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">厦门岛</a>东南隅的<a href=\"https://baike.baidu.com/item/%E4%B8%87%E7%9F%B3%E5%B1%B1?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">万石山</a>中，背靠<a href=\"https://baike.baidu.com/item/%E4%BA%94%E8%80%81%E5%B3%B0/6090519?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">五老峰</a>、<a href=\"https://baike.baidu.com/item/%E5%8D%97%E6%99%AE%E9%99%80%E5%AF%BA/1180153?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">南普陀寺</a>、<a href=\"https://baike.baidu.com/item/%E5%8E%A6%E9%97%A8%E5%A4%A7%E5%AD%A6/192083?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">厦门大学</a>，紧邻<a href=\"https://baike.baidu.com/item/%E4%B8%AD%E5%B1%B1%E8%B7%AF/6314795?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">中山路</a>商圈。始建于1960年，占地4.93平方公里，是<a href=\"https://baike.baidu.com/item/%E7%A6%8F%E5%BB%BA%E7%9C%81/122534?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">福建省</a>第一个植物园，是<a href=\"https://baike.baidu.com/item/%E9%BC%93%E6%B5%AA%E5%B1%BF%E2%80%94%E4%B8%87%E7%9F%B3%E5%B1%B1%E9%A3%8E%E6%99%AF%E5%90%8D%E8%83%9C%E5%8C%BA/7271800?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">鼓浪屿—万石山风景名胜区</a>的重要组成部分，集植物景观、自然景观、人文景观于一体。</p><p>	厦门园林植物园是国家首批AAAA级旅游区，是省、市和国家级科普教育基地、福建省首批环境教育基地与保护母亲河生态教育基地</p>', '思明区', NULL, '24.45343933254422,118.10186862945558;24.452736147072166,118.10521602630617;24.451798560338144,118.10504436492921;24.449571763884645,118.10573101043703;24.448204413229806,118.10560226440431;24.447266792777803,118.10598850250246;24.446993318831993,118.10680389404298;24.44658310680064,118.10661077499391;24.446954251077003,118.10569882392885;24.446817513839182,118.104465007782;24.44644636916016,118.10358524322511;24.446749145164638,118.10317754745485;24.447843039506765,118.10272693634035;24.448956457925906,118.10131072998048;24.450821900071602,118.10124635696411;24.451993891483063,118.10217976570131;24.452804512498613,118.10163259506227', NULL, '10.11.0.87', NULL, '2022-09-02 14:02:47', NULL, NULL, 'cbc', '0');


