INSERT INTO `pt_hotel` VALUES (1, '思明区中华街道中山路98号', '七天酒店', '<p>	7天酒店（7 Days Inn）是锦江酒店（中国区）<span style=\"color: rgb(51, 102, 204);\">&nbsp;[1]</span><span style=\"color: rgb(19, 110, 194);\">&nbsp;</span>&nbsp;旗下经济型酒店品牌<span style=\"color: rgb(51, 102, 204);\">&nbsp;[2-3]</span><span style=\"color: rgb(19, 110, 194);\">&nbsp;</span>&nbsp;，成立于2005年，经过快速发展，分店已覆盖全国370个城市<span style=\"color: rgb(51, 102, 204);\">&nbsp;[4-5]</span><span style=\"color: rgb(19, 110, 194);\">&nbsp;</span>&nbsp;，规模达到3000家<span style=\"color: rgb(51, 102, 204);\">&nbsp;[6]</span><span style=\"color: rgb(19, 110, 194);\">&nbsp;</span>&nbsp;。</p><p>	经过15年的发展，7天酒店拥有“7天酒店”、“7天优品”、“7天优品Premium”等住宿系列<span style=\"color: rgb(51, 102, 204);\">&nbsp;[2]</span><span style=\"color: rgb(19, 110, 194);\">&nbsp;</span>&nbsp;。7天酒店已启动全国范围内的创新升级，旨在通过全新7天酒店，为客户带来舒适具有性价比的旅居体验<span style=\"color: rgb(51, 102, 204);\">&nbsp;[7]</span><span style=\"color: rgb(19, 110, 194);\">&nbsp;</span>&nbsp;。</p>', '男', '陈晓明', '思明区', '24.457697427395644', NULL, '10.11.0.87', '118.07126998901369', NULL, '2022-09-02 14:06:06', NULL, '2022-09-02 14:07:00', 'cbc', '0', 'cbc');
INSERT INTO `pt_hotel` VALUES (2, '思明区思明南路56号', '如家酒店', '<p>	如家酒店是<a href=\"https://baike.baidu.com/item/%E5%A6%82%E5%AE%B6%E9%85%92%E5%BA%97%E9%9B%86%E5%9B%A2/8887984?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">如家酒店集团</a>旗下3大品牌之一。</p><p>	如家酒店在全国300个城市拥有近2000家酒店。如家酒店多年获得中国金枕头奖“中国最佳经济型连锁酒店品牌”殊荣。2014年，如家酒店以4.2亿美元的品牌价值入选<a href=\"https://baike.baidu.com/item/%E4%B8%AD%E5%9B%BD%E5%93%81%E7%89%8C/16390090?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">中国品牌</a>100强。</p>', '女', '丽丽', '思明区', '24.452540817077907', NULL, '10.11.0.87', '118.07770729064943', NULL, '2022-09-02 14:08:16', NULL, NULL, 'cbc', '0', NULL);

